CREATE TABLE IF NOT EXISTS django_migrations (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, app varchar(255) NOT NULL, name varchar(255) NOT NULL, applied datetime NOT NULL);
CREATE TABLE IF NOT EXISTS auth_group_permissions (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, group_id integer NOT NULL REFERENCES auth_group (id) , permission_id integer NOT NULL REFERENCES  auth_permission  (id) );
CREATE TABLE IF NOT EXISTS auth_user_groups (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, user_id integer NOT NULL REFERENCES auth_user (id) , group_id integer NOT NULL REFERENCES auth_group (id) );
CREATE TABLE IF NOT EXISTS auth_user_user_permissions (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, user_id integer NOT NULL REFERENCES auth_user (id) , permission_id integer NOT NULL REFERENCES  auth_permission  (id) );
CREATE TABLE IF NOT EXISTS  django_admin_log  (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, action_time datetime NOT NULL, object_id text NULL, object_repr varchar(200) NOT NULL, change_message text NOT NULL, content_type_id integer NULL REFERENCES django_content_type (id) , user_id integer NOT NULL REFERENCES auth_user (id) , action_flag smallint  NOT NULL);
CREATE TABLE IF NOT EXISTS django_content_type (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, app_label varchar(100) NOT NULL, model varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS  auth_permission  (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, content_type_id integer NOT NULL REFERENCES django_content_type (id), codename varchar(100) NOT NULL, name varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS auth_user (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, password varchar(128) NOT NULL, last_login datetime NULL, is_superuser bool NOT NULL, username varchar(150) NOT NULL UNIQUE, first_name varchar(30) NOT NULL, email varchar(254) NOT NULL, is_staff bool NOT NULL, is_active bool NOT NULL, date_joined datetime NOT NULL, last_name varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS  django_session  (session_key varchar(40) NOT NULL PRIMARY KEY, session_data text NOT NULL, expire_date datetime NOT NULL);
CREATE TABLE IF NOT EXISTS faculty_daysofweek (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, day_name varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS faculty_subject_teaching_faculty (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, subject_id integer NOT NULL REFERENCES faculty_subject (id) , user_id integer NOT NULL REFERENCES auth_user (id) );
CREATE TABLE IF NOT EXISTS faculty_leave (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, leave_note text NOT NULL, approved_status bool NOT NULL, leave_start_date date NOT NULL, leave_end_date date NOT NULL, leave_taken_by_id integer NULL REFERENCES auth_user (id) , leave_end_time time NOT NULL, leave_start_time time NOT NULL);
CREATE TABLE IF NOT EXISTS faculty_timeslot (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, end_time time NOT NULL, start_time time NOT NULL);
CREATE TABLE IF NOT EXISTS auth_group (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, name varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS faculty_year (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, year varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS faculty_subject (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, sname varchar(255) NOT NULL, year_id integer NULL REFERENCES faculty_year (id) );
CREATE TABLE IF NOT EXISTS faculty_room (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, room varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS faculty_division (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, division varchar(255) NOT NULL, div_of_id integer NULL REFERENCES faculty_year (id) );
CREATE TABLE IF NOT EXISTS faculty_batch (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, batch varchar(255) NOT NULL, batch_of_div_id integer NULL REFERENCES faculty_division (id) , batch_of_year_id integer NULL REFERENCES faculty_year (id) );
CREATE TABLE IF NOT EXISTS faculty_makeuplecture (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, lec_date date NOT NULL, lec_subject_id integer NOT NULL REFERENCES faculty_subject (id) , lec_taken_by_id integer NOT NULL REFERENCES auth_user (id) , lec_time_id integer NOT NULL REFERENCES faculty_timeslot (id) , division_id integer NOT NULL REFERENCES faculty_division (id) , year_id integer NOT NULL REFERENCES faculty_year (id) , lec_in_id integer NULL REFERENCES faculty_room (id) );
CREATE TABLE IF NOT EXISTS faculty_ia (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, ia_date date NOT NULL, ia_in_id integer NULL REFERENCES faculty_room (id) , ia_subject_id integer NOT NULL REFERENCES faculty_subject (id) , ia_time_id integer NOT NULL REFERENCES faculty_timeslot (id) , ia_year_id integer NOT NULL REFERENCES faculty_year (id) );
CREATE TABLE IF NOT EXISTS faculty_guestlecture (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, lec_date date NOT NULL, lec_in_id integer NULL REFERENCES faculty_room (id) , lec_subject_id integer NOT NULL REFERENCES faculty_subject (id) , lec_time_id integer NOT NULL REFERENCES faculty_timeslot (id) , lec_year_id integer NOT NULL REFERENCES faculty_year (id) );
CREATE TABLE IF NOT EXISTS faculty_od (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, od_type varchar(20) NOT NULL, od_title varchar(255) NOT NULL, od_details text NOT NULL, supporting_organisation varchar(20) NOT NULL, from_date date NOT NULL, to_date date NOT NULL, last_date date NOT NULL, fees integer NULL, scope text NULL, approved_status bool NOT NULL, taken_by_id integer NOT NULL REFERENCES auth_user (id) , correspondence varchar(100) NULL);
CREATE TABLE IF NOT EXISTS mailer_message (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, message_data text NOT NULL, when_added datetime NOT NULL, priority varchar(1) NOT NULL);
CREATE TABLE IF NOT EXISTS mailer_dontsendentry (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, when_added datetime NOT NULL, to_address varchar(254) NOT NULL);
CREATE TABLE IF NOT EXISTS mailer_messagelog (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, message_data text NOT NULL, when_added datetime NOT NULL, priority varchar(1) NOT NULL, when_attempted datetime NOT NULL, result varchar(1) NOT NULL, log_message text NOT NULL, message_id text NULL);
CREATE TABLE IF NOT EXISTS faculty_loadshift (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, for_lecture_id integer NOT NULL REFERENCES faculty_lecture (id) , leave_id integer NULL REFERENCES faculty_leave (id) , to_faculty_id integer NOT NULL REFERENCES auth_user (id) , od_id integer NULL REFERENCES faculty_od (id) , approved_status bool NOT NULL);
CREATE TABLE IF NOT EXISTS jet_bookmark (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, url varchar(200) NOT NULL, title varchar(255) NOT NULL, user integer  NOT NULL CHECK (user >= 0), date_add datetime NOT NULL);
CREATE TABLE IF NOT EXISTS jet_pinnedapplication (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, app_label varchar(255) NOT NULL, user integer  NOT NULL CHECK (user >= 0), date_add datetime NOT NULL);
CREATE TABLE IF NOT EXISTS dashboard_userdashboardmodule (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, title varchar(255) NOT NULL, module varchar(255) NOT NULL, app_label varchar(255) NULL, user integer  NOT NULL, col integer  NOT NULL, ord integer NOT NULL, settings text NOT NULL, children text NOT NULL, collapsed bool NOT NULL);
CREATE TABLE IF NOT EXISTS faculty_lecture (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, lec_day_id integer NOT NULL REFERENCES faculty_daysofweek (id) , lec_div_id integer NULL REFERENCES faculty_division (id) , lec_time_id integer NOT NULL REFERENCES faculty_timeslot (id) , lname_id integer NOT NULL REFERENCES faculty_subject (id) , taken_by_id integer NOT NULL REFERENCES auth_user (id) , lec_in_id integer NULL REFERENCES faculty_room (id) , lec_batch_id integer NULL REFERENCES faculty_batch (id) );
